import Typography from '../atoms/Typography';

const Main = props => {
  return (
    <>
      <main {...props}>
        <div>
          <Typography variant={'h1'} children={'Hello'} />
          <img
            src={'https://images.unsplash.com/photo-1488923937092-5a9ccc6eff59'}
            alt="night waterfall"
          />
        </div>
      </main>
      <style jsx>{`
        div {
          font-size: 30px;
        }
        img {
          height: 100px;
          width: 100px;
        }
      `}</style>
    </>
  );
};

export default Main;
